import Container from '@mui/material/Container'; // Assuming using MUI components
import AppBar from '@mui/material/AppBar';
import Typography from '@mui/material/Typography';
import Img from 'react-image'; // Using 'react-image' for flexibility
import memories from '../src/images/memories.png';

const App = () => {
  return (
    <div>
      <Container maxWidth="lg">
        <Appbar position="static" color="inherit">
          <Typrography variant="h2" align="center">
            Memories
          </Typrography>
          <img src={memories} alt="memories" height="60" />
        </Appbar>
      </Container>
    </div>
  );
};

export default App;
